import { Container, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router";
import CryptoBlock from "../../myComponents/crypto-block/CryptoBlock";
import NavBar from "../../myComponents/navbar/Navbar";

export default function CryptoPage() {

  const cryptoData = [
    "Bitcoin",
    "Gitcoin",
    "Litcoin",
    "LaudaCoin",
    "Bitcoin",
    "Gitcoin",
    "Litcoin",
    "LaudaCoin",
    "Litcoin",
    "LaudaCoin"
  ];

  const navigate = useNavigate();
  const [data, setData] = useState([]);
  const [value, setValue] = useState('');
  const [name, setName] = useState('');

  function getValue(value, name) {
    setValue(value);
    setName(name);
  }

  function handleClose(e) {

    e.preventDefault();
    let mydata = {
      value,
      name,
    }
    setData([...data, mydata]);
    setName('');
    setValue('');
  }

  useEffect(() => {
    localStorage.setItem('data', JSON.stringify(data))
  }, [data])

  return (
    <>
      <Container>
        <NavBar />
       <Box sx={{textAlign: "center", backgroundColor: "gray", padding: "20px"}}>
       <Typography variant="small">
          Crypto Coins
        </Typography>
       </Box>
        <Box>
          {
            cryptoData.map((item) => (
              <CryptoBlock value={getValue} handleClose={handleClose} name={item} />
            ))
          }
        </Box>
      </Container>
    </>
  )
}
